import './TodoItem.css';
import {TodoCheck} from '../TodoIcon/TodoCheck';
import { DeleteIcon } from '../TodoIcon/DeleteIcon';
import { TodosContext } from '../TodosContext';
import React from 'react';

function TodoItem() {

  const {text,completed,onCompleted,onDelete} = React.useContext(TodosContext);
    return (
      <li className='TodoItem'>
        <TodoCheck 
        isDone={completed} 
        markTodoAsCompleted={onCompleted}
        text={text} />
        <p>{text}</p>
        <DeleteIcon
          onDelete={onDelete}
          />
      </li>
    );
  }
  export {TodoItem};
